use super::{find_char_index::FindCharIndex, to_vec::ToVec};

#[derive(Clone, Debug)]
pub struct DayShenSha {
  elems: Option<Vec<DayShenShaElem>>,
}

#[derive(Clone, Debug)]
pub struct DayShenShaElem {
  pub month_day_hash: String,
  pub ji_shen: Vec<String>,
  pub xiong_sha: Vec<String>,
}

impl Default for DayShenSha {
  fn default() -> Self {
    Self { elems: None }
  }
}

impl DayShenSha {
  #[allow(dead_code)]
  pub fn debug_print(&mut self) {
    if self.elems.is_none() {
      self.setup();
    }
  }

  fn setup(&mut self) -> Self {
    // consists of "[(month_day_hash=xx,)]"
    let __compacted = COMPACTED.to_string();
    let __compacted_char_len = __compacted.chars().count();
    let mut delim = __compacted.find_char_index("=");
    let mut elems = vec![];
    while delim.is_some() {
      let start = delim.unwrap() - 3;
      let end = delim.unwrap();
      let month_day_hash = __compacted.slice_by_char_idx(start, end);

      let start = end + 1;
      let end = __compacted.find_char_index_offset(start, ",").unwrap();
      let ji_shen =
        __compacted.slice_by_char_idx(start, end).to_vec_hex_str();

      let start = end + 1;
      let end = __compacted
        .find_char_index_offset(start, "=")
        .map_or(__compacted_char_len, |v| v - 3);
      let xiong_sha =
        __compacted.slice_by_char_idx(start, end).to_vec_hex_str();

      elems.push(DayShenShaElem {
        month_day_hash,
        ji_shen,
        xiong_sha,
      });

      delim = match end == __compacted_char_len {
        true => None,
        _ => Some(end + 3),
      };
    }
    self.elems = Some(elems);
    self.clone()
  }

  pub fn collect_ji_shen_hexs(
    &mut self,
    month_hex: &str,
    day_hex: &str,
  ) -> Vec<String> {
    if self.elems.is_none() {
      self.setup();
    };

    assert!(month_hex.chars().count() == 1);
    let month_day_hash = format!("{month_hex}{day_hex}");
    let found = self
      .elems
      .as_ref()
      .unwrap()
      .iter()
      .filter(|elem| elem.month_day_hash == month_day_hash)
      .map(|elem| elem.ji_shen.clone())
      .flatten()
      .collect::<Vec<_>>();
    found
  }

  pub fn collect_xiong_sha_hexs(
    &mut self,
    month_hex: &str,
    day_hex: &str,
  ) -> Vec<String> {
    if self.elems.is_none() {
      self.setup();
    };

    assert!(month_hex.chars().count() == 1);
    let month_day_hash = format!("{month_hex}{day_hex}");
    let found = self
      .elems
      .as_ref()
      .unwrap()
      .iter()
      .filter(|elem| elem.month_day_hash == month_day_hash)
      .map(|elem| elem.xiong_sha.clone())
      .flatten()
      .collect::<Vec<_>>();
    found
  }
}

